import './index.css';
import Boxes from './components/Boxes/Boxes.js';

export default function App() {  

  function generateBoxes() {
    const boxes="1"
    for (let i = 0; i < 10; ++i) {
      boxes.push(Math.floor(Math.random() * 6) + 1);
    }
    return boxes
  }


  return(
    <main>      
      <Boxes value={generateBoxes}/>            
    </main>
  )
}
